import React from "react";
import Button from "./Button";

import "./Todo.css";

const Todo = (props) => {
  const clickRemoveTodo = () => {
    props.clickRemoveTodo(props.todo.id);
  };

  const clickChangeComplited = () => {
    props.clickChangeComplited(props.todo.id);
  };

  return (
    <li className={props.index % 2 === 0 ? "todo_item odd" : "todo_item even"}>
      <div className="todo_wrapper">
        <input
          type="checkbox"
          checked={props.todo.complited}
          onChange={clickChangeComplited}
        />
        <p className={!props.todo.complited || "doneTodo"}>{props.todo.text}</p>
      </div>
      <Button text="Удалить Todo" click={clickRemoveTodo} />
    </li>
  );
};

export default Todo;
